let sparkLine=[],sparkLineData=[];function createSparkLine(a){for(let[e,n]of Object.entries(a))sparkLine[e]=new Sparkline($(`#sparkline-${e}`)[0],{width:80,height:50,lineColor:"#92c1dc",endColor:"#ebf4f9"}),sparkLineData[e]=[0,n.percentage],sparkLine[e].draw(sparkLineData[e])}function updateSparkLine(a,e){sparkLineData[a].length>9&&sparkLineData[a].shift(),sparkLineData[a].push(e),sparkLine[a].draw(sparkLineData[a])}